import Header from './Header';
import Footer from './Footer';


const layoutStyle = {
    margin: 20,
    padding: 20,
};

const Layout = props => (
    <div>
        <Header />
        <div className="container pt-4 pb-4">
            {props.children}
        </div>
        <Footer />
    </div>
);

export default Layout;
